import React from 'react';
import Navigation from './components/Navigation'
import './App.css';
import Home from './components/Home';

function App() {
  return (
      <div className="App">
        <div>
          <Navigation />
        </div>      
        <div>
          <Home />
        </div>
      </div>
  );
}

export default App;
